import React from 'react'

function LeftSidebar() {
  return (
    <div className='sidebar'>
      <nav>
        <img src="../../../resources/img/icon-nav-home.svg" alt="lofo" className="logo" />
      </nav>
    </div>
  )
}

export default LeftSidebar
